import React, { Component } from "react";
import { Section } from "../Components";

class Homepage extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  render() {
    return (
      <>
        <div>
          <Section primary>
            <div style={{fontSize:"2em", fontWeight :"bold"}}>{`We <3 people who code`}</div>
          </Section>
        </div>
      </>
    );
  }
}

export default Homepage;
